import * as React from 'react';
import { Button } from 'react-native-web';
import { Header,Container,Title,HeaderButtonLeft,HeaderButtonRight} from './styles';
import { View,StyleSheet} from 'react-native';
import { Entypo } from '@expo/vector-icons';
import { Ionicons } from '@expo/vector-icons';


function AddAlarmScreen({navigation,route}) {
    const item = route.params;
    return(
        <View>
            <Header>
                <HeaderButtonLeft>
                    <Ionicons name="chevron-back" size={20} color={"black"} onPress={navigation.goBack} />
                </HeaderButtonLeft>
                <HeaderButtonRight>
                    <Entypo name="dots-two-horizontal" size={20} color="black" />
                </HeaderButtonRight>
                <Title>Add Alarm</Title>
            </Header>
            <Container>
                <Button
                title="Add" 
                onPress={() => navigation.navigate()}
                />
                <View style={style.container}></View>
                <Button
                title="Go to"
                onPress={() => navigation.navigate('AddAlarm')}
                />
            </Container>
        </View>
    );
};
const style = StyleSheet.create({
    container:{
        flexDirection: 'row',
        background: '#F7F8F8',
        width: 315,
        height: 50,
        left: 30,
        top: 102,
        borderRadius: 16
    }    
});

export default AddAlarmScreen;
